Description:
            Teachers have big hearts which help shape little minds, and the best teachers are totally priceless.
Very cute thank you teacher gift for that special teacher who had given your child the confidence to learn and grow! These wish bracelets are 10 inches long and fasten at the back to fit onto any wrist size. The silver tone charm is a perfect way to show your appreciation to the amazing teacher or teaching assistant. Colours available are pink, blue, green, red, purple, black, white and now yellow. If you would like to mix and match the colours please send me a message once payment has been processed.
*** All orders over 30 wish bracelets receive 10% off your bill!! The 10 % has already been taken off the on my prices!!
Each wish bracelet comes delivered on a simple display card with lovely quote and instructions on how to use make a wish. The display cards can be personalised with the teachers name and a thank you note form your child.
Made from wax cord - Please note these bracelets are supposed to wear through (if they don't their wish wont come true!!)
